<!DOCTYPE html>
<html>
<head>
<title>Shipment Label</title>
<meta http-equiv='Content-Type' content='text/html; charset=UTF-8' />
</head>
<body>
	<div id='qrcode' style='width:100px; height:100px; margin-top:15px; display: none;'></div>

	<script type='text/javascript' src='<?php echo $this->config->base_url(); ?>wp-content/js/inc/jspdf.min.js'></script>
	<script type='text/javascript' src='<?php echo $this->config->base_url(); ?>wp-content/js/inc/qrcode.js'></script>
	<script type='text/javascript' src='<?php echo $this->config->base_url(); ?>wp-content/js/inc/code-39.js'></script>
	<script type='text/javascript'>
		function addChar (str, chr, len) {
			var newStr = str;
			
			for (var i=0; i<len-str.length; i++) {
				newStr = chr.concat(newStr);
			}
			
			return newStr;
		}
		
		var qrcode = new QRCode(document.getElementById('qrcode'), {
			width : 100,
			height : 100
		});

		var imgParsel = 'data:image/jpg;base64,';
		
		var row = 297/6;
		var col = 210/2;
		
		var doc = new jsPDF();

		var imgBarcode;
		var imgCode39;
		var label_item;
		
		var collie = <?php echo $collie ?>;
		var print_label = 0;

		while (print_label < collie) {
			doc.rect(0, 1*row, 210, 0);
			doc.rect(0, 2*row, 210, 0);
			doc.rect(0, 3*row, 210, 0);
			doc.rect(0, 4*row, 210, 0);
			doc.rect(0, 5*row, 210, 0);
			doc.rect(1*col, 0, 0, 297);

			for (var i=0; i<6 && print_label<collie; i++) {
				var urut = print_label + 1;

				label_item = '<?php echo $shipment; ?> ' + addChar(String(urut), "0", 5);
				label_barcode = '<?php echo $shipment; ?>' + addChar(String(urut), "0", 5);
				
				imgBarcode = qrcode.getBase64(label_barcode);
				imgCode39 = new Barcode39('*' + label_barcode + '*').toDataURL();

				doc.setFontSize(7);
				doc.text(0*col+10, i*row+12, '<?php echo $perusahaan; ?>');
				doc.text(0*col+10, i*row+15, '<?php echo $alamat; ?>');
				doc.text(0*col+10, i*row+18, '<?php echo $kota . ' ' . $zip . ' ' . $negara; ?>');
				doc.addImage(imgCode39, 'JPEG', 0*col+10, i*row+20, 50, 10);
				doc.setFontSize(12);
				doc.text(0*col+10, i*row+35, label_item + ' / ' + collie);
				doc.addImage(imgBarcode, 'JPEG', 0*col+70, i*row+10, 25, 25);
				doc.setFontSize(7);
				doc.text(0*col+35, i*row+45, 'http://www.parsel.co.id');

				doc.setFontSize(7);
				doc.text(1*col+10, i*row+12, '<?php echo $perusahaan; ?>');
				doc.text(1*col+10, i*row+15, '<?php echo $alamat; ?>');
				doc.text(1*col+10, i*row+18, '<?php echo $kota . ' ' . $zip . ' ' . $negara; ?>');
				doc.addImage(imgCode39, 'JPEG', 1*col+10, i*row+20, 50, 10);
				doc.setFontSize(12);
				doc.text(1*col+10, i*row+35, label_item + ' / ' + collie);
				doc.addImage(imgBarcode, 'JPEG', 1*col+70, i*row+10, 25, 25);
				doc.setFontSize(7);
				doc.text(1*col+35, i*row+45, 'http://www.parsel.co.id');

				print_label++;
			}

			if (print_label < collie) {
				doc.addPage();
			}
		}

		doc.save('Label_<?php echo $shipment; ?>.pdf');
	</script>
</body>
</html>
